import React, {Component} from 'react';
import Background from '../photos/contactus.jpg'
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { blue } from '@material-ui/core/colors';
import Typography from '@material-ui/core/Typography';

const styles = theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing.unit * 2,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
});

var sectionStyle = {
    overflow:'hidden',
    width: "100%",
    height: "100vh",
    backgroundColor: '#1a237e',

    backgroundImage: 'linear-gradient(#1a237e,#303f9f,#3f51b5,#5c6bc0,#2196f3,#90caf9)'
  };

const div1 = {
  backgroundColor: '#eeeeee',
  width: '35%',
  height: 'auto',
  padding: '100px' 
}

class Contactus extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
             <section style={ sectionStyle }>
                <Grid container spacing={24}>
                    <Grid item xs={6}>
                      <div style={{padding:100}}>
                        <Typography variant="h4" style={{color:'white',fontWeight:800}}gutterBottom>
                          Contact Us
                        </Typography>
                        <Typography variant='subtitle1' style={{color:'white',fontWeight:100}}gutterBottom>
                          Submit your queries here and we will get back to you as soon as possible
                        </Typography>
                      </div>   
                    </Grid>
                    <Grid item xs={6}>
                      <div style={div1}>
                        <div>

                        </div>
                      </div>
                    </Grid>
                </Grid>
            </section>
        )
    }
}

export default Contactus
